import React, {FC} from "react";
import { Image } from "@chakra-ui/react";

interface NFTprops{
    NFTtype: string;
}
const NFT: FC<NFTprops> = ({NFTtype}) => {
    return <Image src={'images/${NFTtype}.png'} alt="NFT"/>;
};

export default NFT;
